import { Link } from 'react-router-dom';
import React from 'react';
import './components/css/About.css';

// 외부페이지는 a 사용
function About(){
    return(
     <div className={"view-class"}>
       <h2> Credits </h2>
       <button className={"button-class"}  onClick={() => window.open("https://icon-icons.com/ko/%EC%95%84%EC%9D%B4%EC%BD%98/pointer-%EB%A1%9C%EA%B7%B8%EC%9D%B8-%EC%9C%84%EC%B9%98-%EB%B0%A9%ED%96%A5-%EC%98%A4%EB%A5%B8%EC%AA%BD-%ED%99%94%EC%82%B4%ED%91%9C/258765")}> 사용한 Favicon </button>
     </div>  
    )
}

export default About;
